import React,{useState,useEffect} from 'react';
import logo from './logo.svg';
import { Button,Container,Row,Col } from 'reactstrap';

function List({item, index, editTask}) {




const {picture, value, label } = item.item
    return (
    <Container className="card" style={{marginTop:"10px"}}>
      <Row key={index} style={{paddingTop:"10px"}}>
        <Col md="4">
          <img src={picture}>
          </img>
        </Col>
        <Col md="4">
          {label}
        </Col>

        <Col md="4">
          <Button color="primary" onClick={() => editTask(index)}>Edit</Button>
          <Button color="danger" style={{marginLeft:"5px"}}>Delete</Button>
        </Col>
      </Row>
    </Container>
  );
}

export default List;
